export const mutations = {
    GET_ALL_NEWS(state) {
        state.shownNews = state.newsList.filter(el => !el.isDraft).reverse()
    },
    GET_RUBRIC_NEWS(state, uri) {
        // const newsByUri = state.newsList.filter(el => el.rubricsUri.indexOf(uri) !== -1 && !el.isDraft).reverse()
        // state.shownNews = [...newsByUri]
        state.shownNews = state.newsList.filter(el => el.rubricsUri.indexOf(uri) !== -1 && !el.isDraft).reverse()
    },
    ADD_ARTICLE(state, article) {
        state.newsList.push(article)
    },
    DELETE_ARTICLE(state, id) {
        const articleIndex = state.newsList.findIndex(el => el.id === id)
        state.newsList.splice(articleIndex, 1)
    },
    GET_DRAFTS(state) {
        // const drafts = state.newsList.filter(el => el.isDraft)
        // state.adminNews = [...drafts]
        state.adminNews = state.newsList.filter(el => el.isDraft).reverse()
    },
    GET_PUBLISHED(state) {
        // const published = state.newsList.filter(el => !el.isDraft)
        // state.adminNews = [...published]
        state.adminNews = state.newsList.filter(el => !el.isDraft).reverse()
    },
    GET_AUTHORS_ARTICLES(state) {
        const published = state.newsList.filter(el => el.id === 22222222)
        state.adminNews = [...published]
    },
    TOGGLE_DRAFT(state, id) {
        const article = state.newsList.find(el => el.id === id)
        article.isDraft = !article.isDraft
    }

}
export const actions = {
    toggleDraft({commit}, data) {
        commit('TOGGLE_DRAFT', data.id)
        commit(data.commit)
    }
}
